<?php

$receiving_email_address = 'risingtidebjjuk@gmail.com';

if (file_exists($php_email_form = '../assets/vendor/php-email-form/php-email-form.php')) {
    include($php_email_form);
} else {
    die('Unable to load the "PHP Email Form" Library!');
}

$contact = new PHP_Email_Form;
$contact->ajax = true;

$contact->to = $receiving_email_address;
$contact->from_name = $_POST['name'];
$contact->from_email = $_POST['email'];
$contact->subject = $_POST['subject'];

$message_content = "<html><body style='font-family: Arial, sans-serif; padding: 20px;'>";
$message_content .= "<img src='data:image/png;base64,' style='max-width: 150px; display:block; margin-bottom:20px;'>";
$message_content .= "<h2 style='color: #333;'>New email received from website:</h2>";
$message_content .= "<p><strong>From:</strong> " . htmlspecialchars($_POST['name']) . "</p>";
$message_content .= "<p><strong>Email:</strong> " . htmlspecialchars($_POST['email']) . "</p>";
$message_content .= "<p><strong>Subject:</strong> " . htmlspecialchars($_POST['subject']) . "</p>";
$message_content .= "<p><strong>Message:</strong><br>" . nl2br(htmlspecialchars($_POST['message'])) . "</p>";
$message_content .= "</body></html>";

$contact->message = $message_content;

$contact->headers .= "MIME-Version: 1.0" . "\r\n";
$contact->headers .= "Content-Type: text/html; charset=ISO-8859-1" . "\r\n";

echo $contact->send();
?>
